import React, { useEffect, useState } from 'react';

function WellnessReport() {
  const [data, setData] = useState([]);
  const [dailyAverages, setDailyAverages] = useState({});
  const [playerRollingAverages, setPlayerRollingAverages] = useState({});
  const [teamRollingAverages, setTeamRollingAverages] = useState([]);

  const sheetUrl = "https://opensheet.elk.sh/1x1e53gsx3VzEJ5ON5QOvYeJTGI8auMtSxJYYpUUmreY/Wallnes";

  useEffect(() => {
    fetch(sheetUrl)
      .then(res => res.json())
      .then(json => {
        const parsedData = json.map(entry => ({
          name: entry["Name"],
          date: entry["Timestamp"].split(" ")[0],
          sleep: Number(entry["What is the quality of your sleep at night?"]),
          sore: Number(entry["How sore are you?"]),
          fatigue: Number(entry["How Fatigued are you?"])
        })).filter(e => e.name && !isNaN(e.sleep) && !isNaN(e.sore) && !isNaN(e.fatigue));

        setData(parsedData);

        // Daily averages
        const daily = {};
        parsedData.forEach(e => {
          if (!daily[e.date]) daily[e.date] = { sleep: 0, sore: 0, fatigue: 0, count: 0 };
          daily[e.date].sleep += e.sleep;
          daily[e.date].sore += e.sore;
          daily[e.date].fatigue += e.fatigue;
          daily[e.date].count++;
        });

        const dailyAvg = {};
        Object.keys(daily).forEach(date => {
          const d = daily[date];
          dailyAvg[date] = {
            sleep: (d.sleep / d.count).toFixed(2),
            sore: (d.sore / d.count).toFixed(2),
            fatigue: (d.fatigue / d.count).toFixed(2)
          };
        });
        setDailyAverages(dailyAvg);

        // Rolling average per player (2‚Äì10 days)
        const byPlayer = {};
        parsedData.forEach(e => {
          if (!byPlayer[e.name]) byPlayer[e.name] = [];
          byPlayer[e.name].push(e);
        });

        const playerRolling = {};
        Object.entries(byPlayer).forEach(([name, entries]) => {
          const sorted = [...entries].sort((a, b) => new Date(b.date) - new Date(a.date));
          playerRolling[name] = {};
          for (let days = 2; days <= 10; days++) {
            const recent = sorted.slice(0, days);
            if (recent.length > 0) {
              const avg = {
                sleep: (recent.reduce((s, e) => s + e.sleep, 0) / recent.length).toFixed(2),
                sore: (recent.reduce((s, e) => s + e.sore, 0) / recent.length).toFixed(2),
                fatigue: (recent.reduce((s, e) => s + e.fatigue, 0) / recent.length).toFixed(2)
              };
              playerRolling[name][days] = avg;
            }
          }
        });
        setPlayerRollingAverages(playerRolling);

        // Rolling team averages per day
        const sortedByDate = Object.keys(dailyAvg).sort((a, b) => new Date(b) - new Date(a));
        const teamRolling = [];
        for (let days = 1; days <= 10; days++) {
          const recent = sortedByDate.slice(0, days);
          if (recent.length > 0) {
            let sleep = 0, sore = 0, fatigue = 0;
            recent.forEach(date => {
              sleep += Number(dailyAvg[date].sleep);
              sore += Number(dailyAvg[date].sore);
              fatigue += Number(dailyAvg[date].fatigue);
            });
            teamRolling.push({
              days,
              sleep: (sleep / recent.length).toFixed(2),
              sore: (sore / recent.length).toFixed(2),
              fatigue: (fatigue / recent.length).toFixed(2)
            });
          }
        }
        setTeamRollingAverages(teamRolling);
      });
  }, []);

  return (
    <div className="wellness-report" dir="rtl" style={{ padding: '20px' }}>
      <h1>◊ì◊ï◊ó Wellness</h1>

      <h2>üìÖ ◊û◊û◊ï◊¶◊¢ ◊ß◊ë◊ï◊¶◊™◊ô ◊ú◊§◊ô ◊™◊ê◊®◊ô◊õ◊ô◊ù</h2>
      <table border="1" cellPadding="8" style={{ marginBottom: '20px', width: '100%', textAlign: 'center' }}>
        <thead>
          <tr>
            <th>◊™◊ê◊®◊ô◊ö</th>
            <th>◊©◊ô◊†◊î</th>
            <th>◊¢◊ô◊ô◊§◊ï◊™</th>
            <th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù</th>
          </tr>
        </thead>
        <tbody>
          {Object.entries(dailyAverages).map(([date, avg]) => (
            <tr key={date}>
              <td>{date}</td>
              <td>{avg.sleep}</td>
              <td>{avg.fatigue}</td>
              <td>{avg.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>üë§ ◊û◊û◊ï◊¶◊¢ ◊©◊ó◊ß◊†◊ô◊ï◊™ ◊ú◊§◊ô ◊ô◊û◊ô◊ù ◊ê◊ó◊®◊ï◊†◊ô◊ù</h2>
      {Object.entries(playerRollingAverages).map(([name, days]) => (
        <div key={name} style={{ marginBottom: '20px' }}>
          <h3>{name}</h3>
          <table border="1" cellPadding="6" style={{ width: '100%', textAlign: 'center' }}>
            <thead>
              <tr>
                <th>◊û◊°◊§◊® ◊ô◊û◊ô◊ù</th>
                <th>◊©◊ô◊†◊î</th>
                <th>◊¢◊ô◊ô◊§◊ï◊™</th>
                <th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(days).map(([num, avg]) => (
                <tr key={num}>
                  <td>{num}</td>
                  <td>{avg.sleep}</td>
                  <td>{avg.fatigue}</td>
                  <td>{avg.sore}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}

      <h2>üí™ ◊û◊û◊ï◊¶◊¢ ◊ß◊ë◊ï◊¶◊™◊ô ◊ú◊§◊ô X ◊ô◊û◊ô◊ù ◊ê◊ó◊®◊ï◊†◊ô◊ù</h2>
      <table border="1" cellPadding="6" style={{ width: '100%', textAlign: 'center' }}>
        <thead>
          <tr>
            <th>◊û◊°◊§◊® ◊ô◊û◊ô◊ù</th>
            <th>◊©◊ô◊†◊î</th>
            <th>◊¢◊ô◊ô◊§◊ï◊™</th>
            <th>◊õ◊ê◊ë◊ô ◊©◊®◊ô◊®◊ô◊ù</th>
          </tr>
        </thead>
        <tbody>
          {teamRollingAverages.map((entry, i) => (
            <tr key={i}>
              <td>{entry.days}</td>
              <td>{entry.sleep}</td>
              <td>{entry.fatigue}</td>
              <td>{entry.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default WellnessReport;
